"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[1228],{5014:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"projetos-2025","metadata":{"permalink":"/Processador-ICMC/blog/projetos-2025","source":"@site/blog/2024-08-16-projetos-2024.md","title":"Projetos de jogos, turmas de 2025","description":"Frogger Demake","date":"2024-08-16T00:00:00.000Z","tags":[{"inline":false,"label":"Inscri\xe7\xf5es","permalink":"/Processador-ICMC/blog/tags/inscricoes","description":"Planilhas listando projetos feitos por alunos e a data da apresenta\xe7\xe3o destes"}],"readingTime":1.05,"hasTruncateMarker":false,"authors":[{"name":"Guilherme de Abreu Barreto","title":"Aluno do curso de Ci\xeancia da Computa\xe7\xe3o","url":"https://git.disroot.org/abreu","email":"de_abreu@usp.br","social":{"github":"de-abreu"},"imageURL":"https://git.disroot.org/avatars/c84c3bacdc2a95c4575c5cfbb309f8da","key":"abreu","page":null}],"frontMatter":{"slug":"projetos-2025","title":"Projetos de jogos, turmas de 2025","authors":"abreu","tags":["inscricoes"]},"unlisted":false},"content":"![Frogger Demake](https://github.com/de-abreu/frogger-demake/raw/main/screencapture.png)\\n\\n> Simulador executando *Frogger Demake*, projeto desenvolvido no ano anterior\\n\\nAs seguintes planilhas descrevem os projetos e as datas de apresenta\xe7\xe3o dos jogos \uff0d *que haver\xe3o de ser* \uff0d  criados pelas turmas da disciplina **Pr\xe1tica em Organiza\xe7\xe3o e Arquitetura de Computadores** (SSC0119):\\n\\n- [Projetos](https://docs.google.com/spreadsheets/d/139b0paOBjMLchkTL-MqWzrbRFleIxnT2CeBUTQnGGTI/edit?usp=sharing)\\n- [Apresenta\xe7\xf5es](https://docs.google.com/spreadsheets/d/1yADnkSpJPMvRZS4aW9H9d7QvFtcRUHIftQRed00YM5g/edit?gid=0#gid=0)\\n## Instru\xe7\xf5es aos alunos da disciplina\\nPara editar as planilhas, realize o acesso utilizando seu e-mail USP.\\n\\n### Planilha de projetos\\nPreencha a todos os seguintes campos **em uma linha vaga**:\\n- **Grupo**: um n\xfamero inteiro que deve ser o mesmo entre todos os integrantes do mesmo grupo. Ao inscrever o trabalho do grupo pela primeira vez, utilize o pr\xf3ximo n\xfamero inteiro que n\xe3o tenha sido utilizado (este n\xfamero n\xe3o ter\xe1 qualquer rela\xe7\xe3o com a ordem de apresenta\xe7\xe3o dos trabalhos).\\n- **T\xedtulo do trabalho**: deve ser \xfanico.\\n- **Git**: endere\xe7o de um reposit\xf3rio git contendo os arquivos do projeto sua respectiva documenta\xe7\xe3o.\\n- **Nome e nUSP**: conforme estes constam na carteirinha do aluno.\\n- **Membros**: n\xfamero de integrantes a compor o grupo.\\n\\n### Planilha de apresenta\xe7\xf5es\\n\\nSobrescreva um dos hor\xe1rios dispon\xedveis na planilha (quaisquer campos `\\"--------------\\"`) com a inscri\xe7\xe3o `PORG-xx`, onde `xx` \xe9 o n\xfamero do seu grupo.\\n\\n:::info\\nTodas as apresenta\xe7\xf5es ser\xe3o conduzidas no [Bloco 6 do ICMC](https://www.openstreetmap.org/way/51782620), salas 6-305/306.\\n:::"}]}}')}}]);